import React from 'react';

import styles from './../Style/Components/Editor.module.css';

type MyProps = { };
type MyState = { };
class Editor extends React.Component<MyProps, MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <section className={styles.Container} contentEditable="true">
        <section className={styles.Container} contentEditable="true"></section>
      </section>
    );
  }
}
export default Editor;
